import React from "react";
import ReactDOM from "react-dom";
import Card from './Card';
import "./index.css";
import Sdata from "./Sdata";

ReactDOM.render(
  <>
  <h1>Below are the Example random Data:</h1>

 {Sdata.map((val) => {
    <Card imgsrc={val.imgsrc}
     title ={val.title} 
     sname ={val.sname} 
     href = {val.href}
 />
 })
 };
  </>
  ,document.getElementById('root')

);
